import React from 'react';
import { 
    getEmploye , 
    useEmployeContext,
    useEmployeDispatchContext
  } from '../../contexts/employeContext';


const Employe = () => {

    const dispatch = useEmployeDispatchContext(); 
    const state = useEmployeContext();

    React.useEffect(() => {
        getEmploye(dispatch);
    },[])

    return (
        <div className="main">
           <div className="card-container">
             
           </div>
        </div>
    )
}


export default Employe;
